import React from 'react';

import Top from '../Top/Top';
import Bottom from '../Bottom/Bottom';

import Homes1 from '../Homes/Homes1';
import Homes2 from '../Homes/Homes2';

import Homes4 from '../Homes/Homes4';

const Home = () => {
  return (
    <div>
      <Top />

      <Homes2 />
      <Homes4 />
      <Bottom />
    </div>
  );
};

export default Home;
